import React from 'react';

function Profil() {
    return (
        <div className="profil mb5">
            <h2>Profil</h2>
                <p>
                    Je suis en formation de développeur front end / back end de 
                    sites web et appli mobiles à l'IDEM, j'ai le projet de devenir
                    développeur web. La programmation informatique me passionne et 
                    j'aimerais mettre à profit mes compétences dans ce domaine et
                    les développer davantage via cette formation.
                </p>

        </div>
    );
}

export default Profil;
